// 動態生成使用者資料
function initUserData() {
     const dropdownElement = $('#rankNType');

     // 清空原有的選項
     dropdownElement.empty();
     // 迭代新的選項，並將它們動態添加到下拉列表中
     const optionElement = $('<a class="item"></a>').text("全部");
     optionElement.attr('id', 'all');
     optionElement.on("click", function() {
         $('#selectedRank').text("全部");
         showRankByRankType("",1);
     });
     dropdownElement.append(optionElement);
     rankOptions.forEach(option => {
         const optionElement = $('<a class="item"></a>').text(option.rankName);
         optionElement.attr('id', option.rankType);
         optionElement.on("click", function() {
            $('#selectedRank').text(option.rankName);
             showRankByRankType(option.rankType,0);
         });
         dropdownElement.append(optionElement);
     });
    showRankByRankType("",1);
}
// 調用生成使用者資料函數
initUserData();

function showRankByRankType(rankType,all){
    // 清空原有的使用者資料
    const rankingContainer = $('#rankingContent');
    const rowContainer =$('#rowContainer');
    rankingContainer.empty();
    let findUsers={};
    if(all){
        findUsers=usersData;
    }
    else{
        findUsers= usersData.filter(user => user.rankType === rankType);
    }

    if (findUsers.length === 0) {
        const rankDiv = $("<div>")
            .addClass("rank-div")
            .text("沒有紀錄")
            .appendTo(rankingContainer);
    }else{
        let count=0;
        findUsers.forEach((user, index) => {
            count++;
            switch (count) {
                case 1:
                    rankNumColor="#FFD306";
                    break;
                case 2:
                    rankNumColor="#8E8E8E";
                    break;
                case 3:
                    rankNumColor="#FF8000";
                    break;
                default:
                    rankNumColor="black"; // 黑色，默認顏色
                    break;
            }
            // 獲取使用者對應的 rankOption
            const rankOption = rankOptions.find(option => option.rankType === user.rankType);
            const rowDiv=$("<div>")
                .addClass("row-container")
                .appendTo(rankingContainer);
            const rankNum= $("<div>")
                .addClass("rankNum-div")
                .appendTo(rowDiv)
                .css({
                    "color":rankNumColor // 設置文字顏色
                })
                .text(count);
            // 創建 .rank-div 元素，並設置背景顏色
            const rankDiv = $("<div>")
                .addClass("rank-div")
                .css("border-color", rankOption.rankColor)
                .appendTo(rowDiv);

            // 創建使用者照片
            const photoImg = $('<img>')
                .attr({
                    src: user.photo,
                    alt: `${user.nickname}'s Photo`
                })
                .appendTo(rankDiv);

            // 創建使用者暱稱
            const usernameSpan = $('<span>')
                .addClass("username")
                .text(user.nickname)
                .appendTo(rankDiv);

            // 創建使用者總減碳量
            const carbonOffsetSpan = $('<span>')
                .addClass("carbon-offset")
                .text(`總減碳量: ${user.totalFP}`)
                .appendTo(rankDiv);
        });
    }
}

